CREATE DEFINER=`xwing`@`66.180.204.%` PROCEDURE `UpdateBuildCosts`()
    NO SQL
update builds b
join (select b.id, p.cost + SUM(IFNULL(u.cost, 0)) cost
from builds b
join pilots p on b.pilot_id = p.id
left join build_upgrades bu on bu.build_id = b.id
left join upgrades u on bu.upgrade_id = u.id
group by b.Id, p.cost) c
on c.Id = b.Id
set b.cost = c.cost
where b.cost is null$$

