CREATE DEFINER=`xwing`@`66.180.204.%` FUNCTION `COUNT_IN_LIST`(`build` VARCHAR(5), `list` VARCHAR(50)) RETURNS int(11)
Begin
	DECLARE x int;
    DECLARE templist varchar(50);
    
    SET x = 0;
    SET templist = list;
	WHILE (find_in_set(build, templist) != 0)
    DO
    	IF (find_in_set(build, templist) = 1) THEN Set x = x + 1; END IF;
        
        Set templist = SUBSTRING(templist, locate(',', templist)+1);
        
	END WHILE;
    Return x;
END$$

