(153, 2, 'Chaser', 14, 3, 2, 3, 3, 0, NULL, 2, 'When another friendly ship at Range 1 spends a focus token, assign a focus token to your ship.', 1),
(154, 2, 'Wampa', 14, 4, 2, 3, 3, 0, NULL, 2, 'When attacking, you may cancel all dice results. If you cancel a Critical result, deal 1 face down Damage card to the defender.', 1),
