INSERT INTO `upgrades` (`id`, `name`, `cost`, `type`, `faction`, `ship`, `effect`, `unique`) VALUES
(1, 'R2-D2', 4, 'Astromech', 1, 0, 'After executing a green maneuver, you may recover 1 shield (up to your shield value).', 1),
(2, 'R2-F2', 3, 'Astromech', 1, 0, 'Action: Increase your agility value by 1 until the end of this game round.', 1),
(3, 'Determination', 1, 'Elite Pilot Talent', 0, 0, 'When you are dealt a faceup Damage card with the Pilot trait, discard it immediately without resolving its effect.', 0),
(4, 'Marksmanship', 3, 'Elite Pilot Talent', 0, 0, 'Action: When attacking this round, you may change 1 of your [focus] results to a [crit] result and all of your other [focus] results to [hit] results.', 0),
(5, 'Proton Torpedoes', 4, 'Torpedo', 0, 0, 'Attack Value: 4, Range: 2-3. Attack (Target Lock): Spend your target lock and discard this card to perform this attack. You may change 1 of your [focus] results to a [crit] result.', 0),
(6, 'R5-K6', 2, 'Astromech', 1, 0, 'After spending your target lock, roll 1 defense die. On a [evade] result, immediately acquire a target lock on that same ship. You cannot spend this target lock during this attack.', 1),
